import React from 'react';

const Footer = () => {
    return (
        <footer class="main-footer">
            <strong>Copyright &copy; 2023-2024 </strong>
            All rights reserved.
            <div class="float-right d-none d-sm-inline-block">
                <b>Version</b> 0.0.1
            </div>
        </footer>
    );
};

export default Footer;
